  false,\n\t\"url\": null,\n\t\"notes\": \"The 1:63,360 Kavik River geologic map area
  consists of ~620 square miles and ties together previous DGGS mapping in the Sadlerochit
  and Shublik Mountains area of the western Arctic National Wildlife Refuge (ANWR)
  on the east and the structurally complex foothills and mountain front near the Kemik
  gas accumulation on the west. The map area exposes a unique intersection of North
  Slope stratigraphy where all three major depositional megasequences are mappable
  in close association (Ellesmerian, Beaufortian, and Brookian).\",\n\t\"license_title\":
